@VAGABOOM - canal de Demis
@VAGABOOMARTE - canal de Nancy
@WeroWeroTV - canal de Mou y Jan
@Mente Despierta - canal de Jess

Nunca habíamos dicho esto antes en frente de la cámara.. Esto es el tema de mi nuevo formato VlogCast y lo estrené con mi amigo suizo italiano mexicano Demis aka VAGABOOM. 

No solo tocamos temas personales sino también globales. ¿En el futuro queremos vivir en México o en Europa? ¿Cómo vivirá la humanidad cuando tengamos 100 años? ¿Qué consejos tenemos para alguién que quiere vivir sus sueño pero se encuentra atrapado en un trabajo que no le llena?

Todas esto y mucho más tocamos en VlogCast, mitad vlog, mitad podcast.

