@Mente Despierta - Canal de Jess
@WeroWeroTV - Canal de Mou y Jan
@No Manches • Qué Rico - Canal de Mou
@VAGABOOM - Canal de Demis
@El Coreano - Canal de Minu
@Ford Quarterman - Canal de Ford

Hablé a mi novia mexicana solo en alemán por 24 horas, sin embargo ella entiende muy poco. Durante todo el día le hice retos divertidos en alemán. 

En la noche tuvimos una cena con Mou, Minu y CheChe donde Jess otra vez tuvo que comprobar su nivel de alemán.

Comenta "Schnitzel mit Senf" si quieres ver más videos relacionados con el idioma alemán en los vlogs como por ejemplo tips para aprender alemán.

Colaboraciones / negocios: https://forms.gle/pNvpAmRSjAT9vqzP7 

